      let ii = (this.elWidth - this.screenWidth) / 12
      let aa = Math.ceil(ii / 100)
      // ii > 100 ? ii / 100 : 1
      aa = parseInt(aa)
      console.log(index)
      console.log(ii)
      console.log(aa)
      index = parseInt(index / (aa * 100)) - 1 >= 0 ? parseInt(index / (aa * 100)) - 1 : 0
