      this.$refs.hello.style.backgroundColor = this.photoClass[index].bgColor
    },
    befor (e) {
      e = e || window.event
      let ca = this.elWidth - this.screenWidth
      let cl = Math.abs(this.l)
      ca = parseInt(ca / 100) * 100 - 123 // 移到最后一张时停止
      // console.log(ca)
      if (e.wheelDelta) {
        // 判断浏览器IE，谷歌滑轮事件
        if (e.wheelDelta > 0 && this.l < 0) {
          // 当滑轮向上滚动时
          this.l += 100
        } else if (e.wheelDelta < 0 && cl < ca) {
          // 当滑轮向下滚动时
          this.l -= 100
        }
      } else if (e.detail) {
        // Firefox滑轮事件
        if (e.detail > 0 && this.l < 0) {
          // 当滑轮向上滚动时
          this.l += 120
        } else if (e.detail < 0 < 0 && cl < ca) {
          // 当滑轮向下滚动时
          this.l -= 120
        }
      }
    }
